import bannerbg from '../assets/img/bannerbg.png';
import bannerbg2 from '../assets/img/bannerbg2.png';
import bannerbg3 from '../assets/img/bannerbg3.png';
import colorsharp from '../assets/img/colorsharp.png';
import colorsharp2 from '../assets/img/colorsharp2.png';
import navicon1 from '../assets/img/navicon1.png';
import navicon2 from '../assets/img/navicon2.png';
import navicon3 from '../assets/img/navicon3.png';


export default {
    navicon1,
    navicon2,
    navicon3,
    bannerbg,
    bannerbg2,
    bannerbg3,
    colorsharp,
    colorsharp2,
};
